s.s3.amazonaws.com/data/imagemanager/42977/journal_search.png\" alt=\"\" /></span></div><div><span style=\"font-family: verdana, helvetica, arial, sans-serif; font-size: small;\">&nbsp;</span></div></center><p>This search takes you to the PSU-only library catalog, which will either display your title or will display a page that says<strong><em>&nbsp;Your entry ___ would be here</em></strong>. If you get that message, make sure you entered&nbsp; the exact title correctly. If the library does not have that journal in our collection, then request the article through<strong><a href=\"https://ill.lib.pdx.edu/Logon.php\" target=\"_blank\">&nbsp;Interlibrary Loan.</a></strong></p><p>If we do have the journal, it will show up as either a print volume, an electronic volume,&nbsp;or both. If ithe record states&nbsp;<strong>[electronic resource]</strong>, then it is available online. The other record will show print or microform availability. Click on each record to see the dates that we have access to at PSU.&nbsp;</p><p>&nbsp;</p><p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://lgimages.s3.amazonaws.com/data/imagemanager/42977/journal_search_catalog1.png\" alt=\"\" width=\"500\" /></p><p>&nbsp;</p><p>Clicking on the electronic resource link shows what years are available online and will provide a link. Clicking on the print option will show the years available on the library shelves as well as the call number where you can find the journal. Some of our older journals are held in storage, and you will need to make a request to get them sent to the PSU Library, which takes one business day.</p><p><em>&nbsp;</em></p><p><em><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://lgimages.s3.amazonaws.com/data/imagemanager/42977/journal_search_catalog2.png\" alt=\"\" width=\"500\" /></em></p><p><em>&nbsp;</em></p><p>If the article is available online, browse the issue, or search for the specific title of the article.